import json
import requests

def getMeetingJson(guid):
    url = "https://use2-2.api.microsoftstream.com/api/videos/" + guid + "/events?$filter=Type%20eq%20%27transcript%27&api-version=1.4-private&hostcorrelationid=undefined"
    headers = {
    'user-agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/84.0.4147.89 Safari/537.36 Edg/84.0.522.48',
    'cookie':'; Signature=4MxZStHcPPhXU0IwleMTEKwY6Qs63keXSJDFP192%252bHY%253d; Authorization_; Signature_Api=4MxZStHcPPhXU0IwleMTEKwY6Qs63keXSJDFP192%252bHY%253d; UserSession_Api=signature=C0C11vatZQXoi883fRmlasXVQlH8trpUvw-8xGpIUtA&',
    "sec-fetch-site":"none",
    "sec-fetch-mode":"navigate",
    "sec-fetch-user":"?1",
    "sec-fetch-dest":"document",
    "accept-language":"en-US,en;q=0.9",
    "authority":"use2-2.api.microsoftstream.com",
    "cache-control":"max-age=0",
    "upgrade-insecure-requests":"1",
    "accept":"text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,image/apng,*/*;q=0.8,application/signed-exchange;v=b3;q=0.9",
    }
    request = requests.get(url, headers=headers)
    #print(request)
    jsonContent = json.loads(request.text)
    textDump = ""
    for item in jsonContent["value"]:
       #print(item)
        textDump = textDump + " " + item['eventData']["text"]
    #print(textDump)
    return textDump

def getTimeStamps(guid, search_name):
   
    url = "https://use2-2.api.microsoftstream.com/api/videos/" + guid + "/events?$search=" + search_name + "&$filter=Type%20eq%20%27transcript%27&api-version=1.4-private&hostcorrelationid=undefined"
    headers = {
    'user-agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/84.0.4147.89 Safari/537.36 Edg/84.0.522.48',
   'cookie':'; Signature=4MxZStHcPPhXU0IwleMTEKwY6Qs63keXSJDFP192%252bHY%253d; Authorization_; Signature_Api=4MxZStHcPPhXU0IwleMTEKwY6Qs63keXSJDFP192%252bHY%253d; UserSession_Api=signature=C0C11vatZQXoi883fRmlasXVQlH8trpUvw-8xGpIUtA&',
    "sec-fetch-site":"none",
    "sec-fetch-mode":"navigate",
    "sec-fetch-user":"?1",
    "sec-fetch-dest":"document",
    "accept-language":"en-US,en;q=0.9",
    "authority":"use2-2.api.microsoftstream.com",
    "cache-control":"max-age=0",
    "upgrade-insecure-requests":"1",
    "accept":"text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,image/apng,*/*;q=0.8,application/signed-exchange;v=b3;q=0.9",
    }
    request = requests.get(url, headers=headers)

    jsonContent = json.loads(request.text)

    start_times_list = []

    for item in jsonContent["value"]:
        timestamp_start = item['start']
        timestamp_start = timestamp_start[1:]
        start_times_list.append(timestamp_start)
    return start_times_list
 
